import React from 'react';
import { Link } from 'react-router-dom';

class About extends React.Component {
    render() {
        return (
            <div className="container">
                <h2>ELISE BRENNA</h2>
                <div className="nav-bar">
                    <nav>
                        <Link to="/">WORK</Link> 
                        <Link to="/about">ABOUT</Link> 
                        <Link to="/contact">CONTACT</Link> 
                    </nav>
                </div>
                <div className="about">
                    <h4>Elise is situated in the capital of Norway, Oslo.
                        She graduated from Westerdals ACT in 2014 with a bachelor degree in Retail Design.
                        For the next 8 years she worked in the fashion industry as a brand manager, before
                        she decided to change her career. 
                    </h4>
                </div>
            </div>
        )
    }
}

export default About;
